import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const categories = [
  {
    name: "Kitchen",
    image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT1-x3V5BXk0ovdPlxaEAG9WXOdLK-45X5TAg&s",
    path: "/kitchen",
  },
    {
    name: "Study Room",
    image: "data:image/jpeg;base64,",
    path: "/studyroom",
  },
  {
    name: "Art Studio",
    image: "data:image/jpeg;base64,",
    path: "/artstudio",
  },
  {
    name: "Office Space",
    image: "data:image/jpeg;base64,",
    path: "/officespace",
  },
  {
    name: "Meeting Room",
    image: "data:image/jpeg;base64,",
    path: "/meetingroom",
  },
  {
    name: "Garage",
    image: "data:image/jpeg;base64,",
    path: "/garage",
  },

];

const AllCategories = () => {
  const navigate = useNavigate();
  const [listings, setListings] = useState([]);

  // Fetch listings from backend
  useEffect(() => {
    const fetchListings = async () => {
      try {
        const res = await axios.get("http://localhost:5000/api/spaces");
        setListings(res.data);
      } catch (error) {
        console.error("Error fetching listings:", error);
      }
    };
    fetchListings();
  }, []);

  const handleCardClick = (listing) => {
    navigate(`/details/${listing._id}`, { state: { listing } });
  };

  const handleCategoryClick = (path) => {
    navigate(path);
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Categories</h2>
      <div className="flex overflow-x-auto space-x-4 mb-8 pb-2">
        {categories.map((cat, index) => (
          <div
            key={index}
            onClick={() => handleCategoryClick(cat.path)}
            className="min-w-[100px] flex-shrink-0 text-center cursor-pointer"
          >
            <img
              src={cat.image}
              alt={cat.name}
              className="w-24 h-24 object-cover rounded-full shadow-md mx-auto"
            />
            <h3 className="mt-2 text-sm font-medium">{cat.name}</h3>
          </div>
        ))}
      </div>

      <h2 className="text-2xl font-bold mb-4">All Listings</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {listings.map((listing) => (
          <div
            key={listing._id}
            onClick={() => handleCardClick(listing)}
            className="cursor-pointer bg-white rounded-xl shadow-md overflow-hidden hover:shadow-lg transition"
          >
            <img
              src={listing.imageUrl}
              alt={listing.title}
              className="w-full h-48 object-cover"
            />
            <div className="p-4">
              <h3 className="text-lg font-semibold">{listing.title}</h3>
              <p className="text-gray-600 text-sm">{listing.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AllCategories;
